import React, { Component } from 'react'
import './Location.less';
import ImgUrl from './pic.jpg';
import "animate.css";

export default class componentName extends Component {
    render() {
         return (
            <section className="location">
                {/*   员工信息组件  */}
                <ReactCSSTransitionGroup
          transitionEnter={true}
          transitionLeave={true}
          transitionEnterTimeout={2500}
          transitionLeaveTimeout={1500}
          transitionName="animated"
  >
                {/* 这里一定要加上key */}
                {/* className是animate.css中的类名，显示不同动画 */}
              <div key="amache" className="animated fadeInLeftBig" >
                   <img src="/assets/img/history/157.png" alt="" />
              </div>
 </ReactCSSTransitionGroup>
                <div className="wrap">               
                    <span style={{ fontSize: 20 }}>项目地址</span>
                    <p >
                        <img src={ImgUrl} style={{ height: 90, width: 90 }} />
                    </p>
                    <p>项目为第一个React后台管理项目，后期有时间会</p>
                    <p>陆续将自己学习路上的demo放置上去以供参考，欢迎来到我的github逛逛。</p>
                    <p>谢谢观看~</p>
                </div>
            </section>
        )
    }
}
